INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (581, 0, 2, "", 0, 0, "", 60005, 1, 2, "今日の運勢は大吉！　日々の努力が実り、何事も良い方向へ！　　そんな弟くんには、お姉ちゃんのよしよしぎゅ～っをプレゼント♪", 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (582, 0, 2, "", 0, 0, "", 60005, 2, 2, "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", 0);
